/*
@return	y correspondant aux deux angles indiqués.
@pre	le terrain mesure 3m*2m, les balises sont situées aux deux coins d'un petit coté, et au milieu du coté opposé.
@pre 	a est l'angle entre les deux coins, b est l'angle entre le coin 2 et le coté opposé.
*/
Sint16 find_y(Sint16 a, Sint16 b)
{
	Sint16 ret;
	if(a+b>128)		//cas impossible, return 0
		return BAD;
	if(a==0 || b==0)
		return BAD;
	unsigned psv_shadow;	//psv_shadow recoit la valeur sauvegardée de PSVPAG
	psv_shadow = PSVPAG;
	PSVPAG = __builtin_psvpage (tableau_y);	
	if(b<65)		//Astuce pour économiser de la place !
		ret = tableau_y[b-1][a-1];
	else
		ret = tableau_y[127-b+1][127-a];
	PSVPAG = psv_shadow;	
	return ret;
}

Sint16 find_x(Sint16 a, Sint16 b)
{
	Sint16 ret;
	if(a+b>128)
		return BAD;
	if(a==0 || b==0)
		return BAD;
	unsigned psv_shadow;
	psv_shadow = PSVPAG;
	PSVPAG = __builtin_psvpage (tableau_x);
	if(b<65)		//Astuce pour économiser de la place !
		ret = tableau_x[b-1][a-1];
	else
		ret = tableau_x[127-b+1][127-a];
	PSVPAG = psv_shadow;
	return ret;
}

